css:
@-moz-document domain(www.frei3.de) {
body{
	background: rgba(32, 34, 37, 1)!important;
	color: rgb(125, 130, 135)!important;
}
.f3-sub-navi{
	border: 1px solid #1dbaff!important;
}
#f3page-article .video-infos h2{
	color:rgb(217, 220, 222)!important;
}
#f3page-article #article-view{
	background: rgb(66, 70, 77)!important;
	color: rgb(125, 130, 135)!important;
}
.bg-grau5,
.f3-std-box-rect,
.modal .modal-content,
#f3page-indexPublic .combi-row .comic-row,
.card, .card-user, .card-article, .card-forum, .card-studio, .card-series{
	background-color: rgb(54, 57, 62)!important;
}
h5{
	font-weight: bold!important;
	border-bottom: 1px solid #1dbaff!important;
	color: #1dbaff!important;
}
.f3-button-blue-light{
	color: #1dbaff !important;
	border-color: #1dbaff !important;
	background-color: rgb(66, 70, 77) !important;
}
h1 .strong, h2 .strong, h3 .strong, h4 .strong, h5 .strong, h6 .strong,
.grau4{
	color: #1dbaff!important;
}
.f3-std-box,
div.comments-all div.single-comment .comment-area .comment-main-area .comment-footer{
	background-color: rgb(66, 70, 77)!important;
}
.comment-footer{
    background: rgb(66, 70, 77)!important;
}
.comment-main-area{
    color: rgb(125, 130, 135)!important;
}
#sidenavLeft .sidenav-copyright,
#sidenavLeft .sidenav-copyright a{
    color: #1dbaff!important;
}
#sidenavLeft{
    background-color: rgba(74, 76, 82, 1)!important;
}
.sidenav ul li{
    border: 0px!important;
}
#t5-alerts .alert.alert-success{
    background-color: rgb(47, 49, 54)!important;
}
#t5-alerts .control-panel{
    border-bottom: 0px!important;
}
.sidenav a, .sidenav div.a-style{
    background-color: rgb(66, 70, 77)!important;
}
#faqModal p,
label,
#f3page-about p, #f3page-donation p{
    color: #fff!important;
}
#sidenavLeft .closebtn{
    background: transparent!important;
}
.fa-reply-all{
    color: rgba(32, 34, 37, 1)!important;
}
div.comments-all div.single-comment .comment-area .comment-main-area .comment-footer .comment-discussion:hover .comment-child-count, div.comments-all div.single-comment .comment-area .comment-main-area .comment-footer .comment-discussion:hover .comment-child-count + span{
    color: #787878!important;
}
}
